M-as-a-judge approach, and verifies solutions and tests using a robust test framework. Additionally, the <b>SWE-MERA</b> leaderboard lets users choose issues from different time periods, making it easier to detect models affected by data contamination. <p>Benchmarks like SWE-bench are designed to evaluate the ability of AI systems to solve issues from real repositories. Each task comes with a reference solution and a test patch that allows one to verify correctness of the solution: the tests in this patch should fail before the solution is applied and successfully pass afterwards. SWE-bench has become a standard for evaluating large language models (LLMs) on programming tasks, particularly through its SWE-bench/Lite and SWE-bench/Verified subsets. However, since the benchmark is static and both the tasks and their solutions are publicly available, the risk of data contamination increases.</p>"},xa={ru:"Модель",eng:"Model"},_a={ru:"Позиция",eng:"Position"},Sa={ru:"Задачи",eng:"Tasks"},Ra={ru:"Ссылка",eng:"Trajectory"},qa={ru:"Данных за этот период нет",eng:"No data for this period"},La={header:ha,home:Ca,leaderboard:va,headerBlockFirst:ga,textBlockFirst:Da,model:xa,position:_a,tasks:Sa,trajectory:Ra,notExistedData:qa},ud=Object.freeze(Object.defineProperty({__proto__:null,default:La,header:ha,headerBlockFirst:ga,home:Ca,leaderboard:va,model:xa,notExistedData:qa,position:_a,tasks:Sa,textBlockFirst:Da,trajectory:Ra},Symbol.toStringTag,{value:"Module"})),a1=(e,a)=>La[e]?.[a]||"";var kd=I('<article class="description__text-wrapper svelte-16dx38b"><!></article>'),hd=I('<section class="description svelte-16dx38b"><!></section>');function Cd(e,a){r1(a,!1);const d=te("language");let c=F();const f=d.subscribe(r=>{g(c,r)});le(f),M1();var b=hd(),o=u(b);const t=o0(()=>a1("headerBlockFirst",l(c)));wd(o,{get headerBlock(){return l(t)},children:(r,n)=>{var p=kd(),B=u(p);R4(B,()=>a1("textBlockFirst",l(c))),_(r,p)},$$slots:{default:!0}}),_(e,b),n1()}const vd="modulepreload",gd=functi
